import React from "react";

const GuessPopup = ({ currChosen, currTrack }) => {
  let correct = false;
  if (currChosen === currTrack.country) correct = true;
  return (
    <div className="container">
      <div className="guess-popup">
        <p>
          You guessed {currChosen} and the answer was {currTrack.country}.
        </p>
      </div>
    </div>
  );
};

export default GuessPopup;
